import React, { Component } from "react";
import News_Block from "./News_Block.js";
import data from "../../../SIMULATION_DATABASE/data_BlockNews.json";
import QVdata from "../../../SIMULATION_DATABASE/data_NewsQuickView.json";
class Group_News extends Component {
  render() {
    return (
      <div className="container">
        <h3 className="my-4 text-justify text-center">Tin mới cập nhật</h3>
        <div className="row">
          <News_Block
            id="a"
            block_NavLinkFull={"/" + data[0].linkTopic}
            block_img_src={data[0].imgsrc}
            block_title={data[0].title}
            block_small_content={data[0].description}
            content_for_QuickView={QVdata[0].content}
          />
          <News_Block
            id="b"
            block_NavLinkFull={"/" + data[1].linkTopic}
            block_img_src={data[1].imgsrc}
            block_title={data[1].title}
            block_small_content={data[1].description}
            content_for_QuickView={QVdata[1].content}
          />
          <News_Block
            id="c"
            block_NavLinkFull={"/" + data[2].linkTopic}
            block_img_src={data[2].imgsrc}
            block_title={data[2].title}
            block_small_content={data[2].description}
            content_for_QuickView={QVdata[2].content}
          />
          <News_Block
            id="d"
            block_NavLinkFull={"/" + data[3].linkTopic}
            block_img_src={data[3].imgsrc}
            block_title={data[3].title}
            block_small_content={data[4].description}
            content_for_QuickView={QVdata[4].content}
          />
          <News_Block
            id="e"
            block_NavLinkFull={"/" + data[0].linkTopic}
            block_img_src={data[0].imgsrc}
            block_title={data[0].title}
            block_small_content={data[0].description}
            content_for_QuickView={QVdata[0].content}
          />
          <News_Block
            id="f"
            block_NavLinkFull={"/" + data[0].linkTopic}
            block_img_src={data[0].imgsrc}
            block_title={data[0].title}
            block_small_content={data[0].description}
            content_for_QuickView={QVdata[0].content}
          />

         </div>
      </div>
    );
  }
}

export default Group_News;
